import React, { useEffect, useState } from "react";
// Import the CareerBox component if needed

const Mission = () => {
    const [jobOpening, setJobOpening] = useState([]);

    useEffect(() => {
        fetch("https://cors.io/?https://pastebin.com/raw/xdLmcpTU")
            .then(res => res.json())
            .then(data => {
                setJobOpening(data);
            })
            .catch(error => {
                console.error("Error fetching data: ", error);
            });
    }, []); // Add an empty dependency array to ensure useEffect runs only once

    return (
        <>
            {jobOpening.length > 0 ? (
                jobOpening.map((data, index) => (
                    <div key={index}>
                        {/* Render CareerBox or other components using 'data' */}
                        {/* Example: <CareerBox job={data} /> */}
                        <h1>{data.company}</h1>
                        <p>{data.position}</p>
                        {/* Include other data fields as needed */}
                    </div>
                ))
            ) : (
                <p>Loading...</p>
            )}
        </>
    );
};

export default Mission;
